import React, { useEffect } from "react";
import { useSelector, useDispatch } from "react-redux";

import { orderCompleted } from "../store/action.js";

export function CompleteOrder() {
  const dispatch = useDispatch();
  const { mediaType, mediaLink, orderDetails } = useSelector(
    (state) => state.mediaModule
  );

  const currOreder = {
    mediaType,
    mediaLink,
    orderDetails,
  };

  useEffect(() => {
    dispatch(orderCompleted(currOreder));
  }, []);

  return (
    <div className="container-complete-order">
    <div className="complete-order flex">
      <h4>{currOreder.mediaType} :סוג</h4>
      <h4>{currOreder.mediaLink} :לינק</h4>
      <h4>{currOreder.orderDetails.fullName} :שם מלא</h4>
      <h4>{currOreder.orderDetails.phoneNumber} :טלפון</h4>
      <h4>{currOreder.orderDetails.email} :אימייל</h4>
      <h3>כתובת למשלוח</h3>
      <h4>{currOreder.orderDetails.address.city} :עיר</h4>
      <h4>{currOreder.orderDetails.address.street} :רחוב</h4>
      <h4>{currOreder.orderDetails.address.number} :מס בית</h4>
      מציג את ההזמנה ומתחבר לאייפיאיי פרטי תשלום
    </div>
    </div>
  );
}
